  return (
    <h1>{props.name}</h1>
  )
  }

const Content = (props) => {
  console.log(props)
  return (
    <div>
      <Part part={props} />
    </div>
  )
}

const Total = (props) => {
  return (
    <p>Number of exercises {props.excersice1 + props.excersice2 + props.excersice3}</p>
  )
}

const Part = (props) => {
  console.log(props)
  return (
    <p>{props.name} {props.excersice}</p>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 =  {
    name:'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name:'Using props to pass data',
    exercises: 7
