  const part3 = {
    name:'State of a component',
    exercises: 14
  }

  return (
    <div>
      <Header name={course} />
      <Content part={part1} />
      <Content part={part2} />
      <Content part={part3} />
      <Total excersice1={part1.exercises} excersice2={part2.exercises} excersice3={part3.exercises} />
    </div>
  )
}

export default App
